import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Section3() {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Make a GET request to retrieve data from the server
    axios.get('http://127.0.0.1:8000/get_data')
      .then((response) => {
        if (Array.isArray(response.data) && response.data.length > 0) {
          setData(response.data);
        } else {
          // Handle the case when no valid data is received
          console.error('No valid data received:', response.data);
          setData([]);
        }
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
        setData([]);
      });
  }, []);

  return (
    <div className="section">
      <h2>Section 3</h2>
      {data.length > 0 ? (
        <div>
          {data.map((item, index) => (
            <div key={index}>
              <p>First Name: {item.first_name || 'N/A'}</p>
              <p>Last Name: {item.last_name || 'N/A'}</p>
              <p>Gender: {item.gender || 'N/A'}</p>
              <p>Size: {item.size || 'N/A'}</p>
              <p>Weight: {item.weight || 'N/A'}</p>
              {item.birthday ? (
                <p>Birthday: {new Date(item.birthday).toLocaleString()}</p>
              ) : (
                <p>Birthday: N/A</p>
              )}
              <p>ID: {item.id}</p>
            </div>
          ))}
        </div>
      ) : (
        <p>No valid data available.</p>
      )}
    </div>
  );
}

export default Section3;
